import './App.css';
import Carous from './Component/Carous';
import Coprrights from './Component/Coprrights';
import Countryname from './Component/countryname';
import Footer from './Component/Footer';
import Images from './Component/images';
import Navbar from './Component/navbar';

function App() {
  return (
    <>
    <Navbar/>
    <Carous/>
    <Images/>
    <Footer/>
    <Countryname/>
    <Coprrights/>
    </>
  );
}

export default App;
